import {
	Box,
	Card,
	CardHeader,
	CardBody,
	Text,
	VStack,
	Input,
	Center,
	CardFooter,
	Button,
	Modal,
	ModalOverlay,
	ModalContent,
	ModalHeader,
	ModalFooter,
	ModalBody,
	ModalCloseButton,
	useDisclosure,
	AlertDialog,
	AlertDialogContent,
} from "@chakra-ui/react";
import { useEffect, useState } from "react";
import CourseForm from "./CourseForm";

function CoursesPage(props) {
	const [courseData, setCourseData] = useState();
	const [accountData, setAccountData] = useState({ data: [] });
	const [searchField, setSearchField] = useState("");
	const { isOpen, onOpen, onClose } = useDisclosure();

	useEffect(() => {
		if (props.resData.found) {
			fetch("/api/courses")
				.then((response) => response.json())
				.then((data) => {
					setCourseData(data);
				});
		}
	}, [props.resData.found]);

	useEffect(() => {
		if (props.resData.found) {
			fetch("/api/accounts")
				.then((response) => response.json())
				.then((data) => {
					setAccountData(data);
				});
		}
	}, [props.resData.found]);

	const handleChange = (e) => {
		setSearchField(e.target.value);
	};

	const handleClick = (e) => {
		switch (props.resData.type) {
			case "student":
				break;

			case "admin":
				break;

			case "teacher":
				break;

			default:
				break;
		}
	};

	return (
		<>
			<Center margin="10px">
				<VStack marginTop="10" width="40%" spacing="5">
					{props.resData.type === "teacher" ? (
						<Button onClick={onOpen}>Create New Course</Button>
					) : (
						<p></p>
					)}
					<Input
						type="search"
						placeholder="Search Courses"
						onChange={handleChange}
					/>
					{"list of courses"}
					<Box style={{ overflowY: "scroll" }} width="100%" height="500">
						{typeof courseData == "undefined" ? (
							<Center>
								<p>Loading....</p>
							</Center>
						) : (
							courseData.data
								.filter((course) => {
									return course.name
										.toLowerCase()
										.includes(searchField.toLowerCase());
								})

								.map((course) => {
									return (
										<Card border="2px" borderColor="black" marginBottom="2">
											<CardHeader borderBottom="2px" borderColor="black">
												<Text>{course.name}</Text>
											</CardHeader>
											<CardBody borderBottom="2px" borderColor="black">
												<Text>{course.desc}</Text>
											</CardBody>
											<CardFooter>
												<Button onClick={handleClick}>
													{props.resData.type === "student" ? (
														<p>Enroll</p>
													) : (
														<p>Edit</p>
													)}
												</Button>
											</CardFooter>
										</Card>
									);
								})
						)}
					</Box>
				</VStack>
			</Center>

			<Modal isOpen={isOpen} onClose={onClose}>
				<ModalOverlay />
				<ModalContent>
					<ModalHeader>Account Creation Form</ModalHeader>
					<ModalCloseButton />
					<ModalBody>
						<CourseForm accData={accountData.data} />
					</ModalBody>

					<ModalFooter></ModalFooter>
				</ModalContent>
			</Modal>
		</>
	);
}

export default CoursesPage;
